script: |
  super -f text -I q10126.spq | sort > q10126.out

inputs:
  - name: q10126.spq
    data: |
      SELECT - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN + col1 * - + CAST ( - CAST ( col1 AS INTEGER ) AS INTEGER ) * - col2 + + col2 AND col2;
  - name: tab1

outputs:
  - name: q10126.out
    data: |
